import React from "react"
import Proj1 from "./Proj1.png"


const styles =  {
img:{
    height: 255,
    width: 255,

},
h5:{
   marginLeft: 48
},
h6:{
    marginLeft: 48

},
card:{
    margin:15,


}
};


function Proj() {
    return(
<div className="card" style={styles.card}>
<img style={styles.img} src={Proj1}/>
<h5 style={styles.h5}>The Ultimate IQ Test</h5>
<h6 style={styles.h6}><a onClick={this.handleClick} style={{cursor:`pointer`}}>Code</a></h6>
</div>


    )
}

export default Proj
